import React, { Component } from "react"
import ReactDOM from "react-dom"

class App extends Component {
  constructor(props) {
    super(props)

    this.state = {
      greet: "hey!"
    }
  }

  render() {
    return <h1>{this.state.greet}</h1>
  }
}

ReactDOM.render(<App />, document.querySelector("#root"))
